import { useEffect, useState } from "react"
import GetCountriesFilter from "../../Controllers/Countries/GetCountriesFilter"


function FilterCountryDropdown({isVisible, filterCountryName}) {

    const [selectedCountries, setSelectedCountries] = useState([]);

    useEffect(async() => {
        
        await GetCountriesByName();

        async function GetCountriesByName() {
            const countries = await GetCountriesFilter(filterCountryName);
            setSelectedCountries(countries);
        }

        console.log(filterCountryName);
    }, [filterCountryName])

    return (
        isVisible &&
            <div className="filter-dropdown">

            </div>
    )
}

export default FilterCountryDropdown;
